import React from "react";
import { connect } from "react-redux";

class ActiveMessage extends React.Component {
  state = {};
  render() {
    return (
      <>
        {this.props.ActiveMes.map(chats => (
          <div>{chats}</div>
        ))}
      </>
    );
  }
}

export default connect(state => ({
  ActiveMes: state.messages
}))(ActiveMessage);
